import React from 'react';
import { useLanguage } from '../contexts/LanguageContext';

const Home = () => {
  const { t } = useLanguage();

  return (
    <div style={{ padding: '2rem', textAlign: 'center' }}>
      <h1>WeSourceYou</h1>
      <p>Welcome to the home page</p>
      <p>Translation test: {t('home.hero.title')}</p>
    </div>
  );
};

export default Home;
